Shadowheart (2009)  

Verenigde Staten
Western / Drama
115 minuten

geregisseerd door Dean Alioto
met Angus Macfadyen, Justin Ament en Daniel Baldwin

James Conners (Justin Ament) komt na een lange periode van afwezigheid weer terug in de stadje Legend in New Mexico om de dood van zijn vader door de meedogenloze Will Tunney (Angus Macfadyen) te wreken. Langs deze weg wint hij zijn verloren liefde Mary Cooper wel weer terug, maar moet hij uiteindelijk kiezen tussen wraak en redding.


